import React, { Component } from 'react';
import { Link } from 'react-router-dom';

class Start extends Component{
    render() {
        return(
            <div>
               <div id="loader"></div>
               <div class="logo-tele">

               </div>
               <div style={{display:"none"}} id="myDiv" className="animate-bottom">
                  <img style={{alignContent:"middle"}} src={require('../static/img/teleflight (2).png')} alt=""/>
                  <h3 style={{fontSize:"18px",fontWeight:"800"}}>Hai everyone..</h3>
                  <p style={{fontSize:"16px"}}>Make a simple your flight.</p><br/>
                  <div className="wrapper">
                  <Link to="/login" className="nav-link button">Sign In</Link>
                  </div>
               </div>
            </div>

        )
    }
}
export default Start;
